  IfStatement(node) {
        if (!node.consequent)
          return
        if (node.consequent.type === 'BlockStatement')
          return

        context.report({
          node,
          message: 'IfStatement without blocks',
          fix(fixer) {
            return [
              fixer.insertTextBefore(node.consequent, '{'),
              fixer.insertTextAfter(node.consequent, '}'),
            ]
          },
        })
      }
